import Navbar from "../src/components/sections/navbar/Navbar";
import About from "../src/components/sections/about/About";


function App() {
  return (
    <>
      <Navbar />
      <Welcome />
      <About />
      <Skills />
      <Projects />
      <Contact />
      <Footer />
    </>
  );
}

export default App;
